INSERT INTO `berita` (`id`, `judul`, `isi`, `gambar`, `tgl_posting`, `sumber_gambar`, `judul_seo`, `status`) VALUES
(1, 'Cara Memilih Nama Domain Yang Baik', '<p>Domain adalah nama unik yang diberikan untuk mengidentifikasi nama server hosting pada jaringan internet. Domain ini untuk mempermudah penyebutan atau pemanggilan data/informasi pada sebuah server. Seperti kita ketahui, untuk mengakses ke lain komputer kita harus menggunakan IP Address. Nah domain ini merupakan alias untuk menggantikan rentetan IP Address tersebut.</p>\r\n<p>TLD adalah nama belakang atau ekstensi dari domain. Contohnya adalah com org info net biz co.id dll. Name Server(NS) merupakan alamat atau lokasi dari suatu server. Misalnya kita mempunyai domain domainku.com yang tersimpan di server. Untuk menuju kesana, pihak server menyediakan NS supaya memudahkan dalam pengaksesan data.</p>\r\n<p>Domain Name Sistem(DNS) adalah aturan yang dipakai dalam penamaan nama domain. Selain DNS ada istilah Propagasi DNS yaitu proses penyebaran dari DNS supaya dikenali oleh seluruh jaringan internet.<br /><br /></p>\r\n<p><strong>Cara Memilih Nama Domain Yang Baik</strong></p>\r\n<p>Tentukan dulu alasan dan tujuan anda membuat web.</p>\r\n<ul>\r\n<li>Bila domain digunakan untuk personal sebaiknya gunakan nama kita sendiri atau bisa juga nama panggilan. Contoh: &nbsp;rudyfoller.com, amienrais.com, megawati.com, jusufkalla.com</li>\r\n<li>Bila anda ingin membuat web untuk suatu komunitas sebaiknya gunakan nama komunitas tersebut. Contoh: bisnispemula.info, pebisnisindonesia.com dll</li>\r\n<li>Bila ingin membuat web untuk promosi usaha/barang/jasa maka sebaiknya memilih nama domain yang berhubungan dengan usaha/barang/jasa yang ditawarkan atau nama perusahaan atau merk usaha. &nbsp;Contoh: bursamobilku.com, afuacmobil.com , primadinamika-ndt.com dll.<br /><br /><br />\r\n<p>Manfaat Nama domain yang baik adalah:</p>\r\n<ul>\r\n<li>Nama domain yang baik dan bagus akan memberikan traffic pengunjung web yang lebih banyak.</li>\r\n<li>Nama domain yang baik dan bagus akan mudah diingat oleh teman, sahabat, rekan bisnis, keluarga, pelanggan, maupun calon pembeli.</li>\r\n</ul>\r\n</li>\r\n</ul>', 'ruang-programmer-832812ruang-programmer-81736cara-memilih-nama-domain-yang-baik-jogja-media-web.jpg', '2014-09-28 07:04:55', 'google.com', 'cara-memilih-nama-domain-yang-baik', 1),
(2, 'Fungsi Dari Sebuah Web', '<p><strong>&nbsp;</strong>Web mempunyai fungsi yang bermacam-macam, tergantung dari tujuan dan jenis web yang dibangun, tetapi secara garis besar dapat berfungsi sebagai :</p>\r\n<ol start=\"1\">\r\n<li>Media Promosi :&nbsp;Sebagai media promosi dapat dibedakan menjadi media promosi utama, misalnya web yang berfungsi sebagai search engine atau <a href=\"http://www.rudywebdesign.com/kios/\">toko Online</a>, atau sebagai penunjang promosi utama, namun web dapat berisi informasi yang lebih lengkap daripada media promosi offline seperti koran atau majalah</li>\r\n<li><a href=\"http://www.rudywebdesign.com/contoh-website.html\">Media Pemasaran</a> :&nbsp;Pada toko online atau system afiliasi, web merupakan media pemasaran yang cukup baik, karena dibandingkan dengan toko sebagaimana di dunia nyata, untuk membangun toko online diperlukan modal yangr relatif lebih kecil, dan dapat beroperasi 24 jam walaupun pemilik web tersebut sedang istirahat atau sedang tidak ditempat, serta dapat diakses darimana saja.</li>\r\n<li>Media Informasi :&nbsp;<a href=\"http://www.afuacmobil.com\">Web porta</a>l dan radio atau tv online menyediakan informasi yang bersifat global karena dapat diakses dari mana saja selama dapat terhubung ke internet, sehingga dapat menjangkau lebih luas daripada media informasi konvensional seperti koran, majalah, radio atau televisi yang bersifat lokal.</li>\r\n<li>Media Pendidikan :&nbsp;Ada komunitas yang membangun web khusus berisi informasi atau artikel yang sarat dengan informasi ilmiah misalnya wikipedia.</li>\r\n<li>Media Komunikasi: &nbsp;Sekarang banyak terdapat web yang dibangun khusus untuk berkomunikasi seperti forum yang dapat memberikan fasilitas bagi para anggotanya untuk saling berbagi informasi atau membantu pemecahan masalah tertentu.</li>\r\n</ol>', 'fungsi-dari-sebuah-web-jogja-media-web.jpg', '2014-09-28 07:32:03', 'google.com', 'fungsi-dari-sebuah-web', 1),
(3, 'Saatnya Anda Memiliki Website', '<p>Salah satu fungsi web adalah sebagai media pemasaran bagi persahaan Anda. Pemasaran Online yang Anda lakukan adalah merupakan proses implementasi marketing plan Anda kedalam media internet, yaitu teknologi informasi berbasis web. Pemasaran Online tidak hanya untuk mendapatkan jumlah traffic web yang banyak namun juga digunakan untuk;</p>\r\n<ol start=\"1\">\r\n<li><strong>Mempelajari Tingkah Laku Visitor</strong><br /> Yaitu untuk melanjutkan hubungan dengan visitor, pelanggan, atau calon pelanggan secara terus menerus dengan periodik basis. Dengan cara ini perusahaan Anda akan dengan mudah mempelajari tingkah laku pelanggan atau calon pelanggan perusahaan Anda, sehingga bisa membantu menentukan kebijakan apa yang tepat bagi perusahaan Anda.</li>\r\n<li><strong>Memudahkan Komunikasi</strong><br /> Hal lain yang cukup memberikan kesan baik bagi perusahaan Anda khususnya upaya untuk memelihara hubungan dengan klien / customer, ataupun partner bisnis perusahaan Anda adalah dengan tetap terjalin komunikasi yang baik. Manjakan klien / customer, ataupun partner bisnis perusahaan Anda dengan berbagai fasilitas dan kemudahan untuk berkomunikasi dengan Anda. Dan media yang paling murah adalah dengan adanya internet melalui email ataupun teknologi lain seperti ICQ, Chatt dan online forum.</li>\r\n<li><strong>Mendapatkan Feedback dan Komunikasi yang Cepat dan Murah</strong><br /> Dengan Internet maka Anda terasa lebih mudah untuk mendapatkan feedback dari pelanggan atau partner bisnis Anda. Pelanggan atau partner bisnis Anda akan lebih menyukai media internet. Mengapa demikian&hellip;? Karena komunikasi yang tanpa batas di internet ini memberikan nilai tambah terutama upaya untuk menekan biaya komunikasi. Bisa Anda bayangkan jika komunikasi antar negara memakai telepon atau fax sebagai media komunikasi, berapa cost yang harus dikeluarkan untuk itu semua&hellip;? dan bandingkan dengan jika Anda menggunakan fasilitas internet, maka Anda akan merasakan bedanya.</li>\r\n<li><strong>Menambah Image/Kesan Bagi Performance Perusahaan</strong><br /> Kesan pertama apa yang ada di benak calon pelanggan/calon partner bisnis Anda saat menerima kartu nama Anda..? tentunya sangat tergantung dari detail contact pada kartu nama Anda, Anda akan merasa lebih yakin jika dalam kartu nama Anda tercantum e-mail dan web Anda. Apa yang akan terjadi selanjutnya adalah, bahwa dengan hal yang sangat sederhana tersebut, Anda akan mudah mendrive calon customer/partner bisnis Anda untuk mengenal bisnis Anda.</li>\r\n<li><strong>Web Adalah Showroom Murah bagi Perusahaan Anda</strong><br /> Anda jangan terlebih dahulu memandang showroom hanya sebagai tempat untuk memajang product-product Anda. Mengapa..? karena web mempunyai multi fungsi, yaitu tidak hanya sebagai tempat untuk memajang product-product Anda, namun segala informasi perusahaan Anda bisa dimasukan kedalam web. Murahkah..? ya&hellip;! Karena tidak sampai hitung puluhan juta Anda bisa memilikinya untuk periode waktu yang tidak terbatas.</li>\r\n<li><strong>Dan masih banyak lainya</strong><br /> Tidak cukup hanya satu dua halaman untuk merinci pentingnya sebuah web bagi perusahaan Anda. Apakah Anda merasa sudah terlambat..? Katakan tidak dan rencanakan mulai sekarang untuk membangun sebuah web bagi perusahaan Anda.</li>\r\n</ol>', 'mengapa-perusahaan-anda-membutuhkan-web-mengapa-pe-jogja-media-web.jpg', '2014-09-28 07:32:30', 'google.com', 'saatnya-anda-memiliki-website', 1),
(4, 'Menghapus Cache  Di Web Browser ?', '<p style=\"text-align: justify;\"><span style=\"font-size: small;\">Ada kasus ketika Anda sudah melakukan update konten website, namun tampilan website tidak berubah. Atau kami sudah upload rivisi website anda dengan versi yang terbaru, namun saat anda akses dari komputer anda, website tampak belum berubah. Itu karena pengaruh Cache atau Cookies pada browser yang anda gunakan. Silahkan refresh browsernya, maka browser akan melakukan load ulang dan website akan tertampil yang sudah terupdate.</span><br /><br /><span style=\"font-size: small;\">Nah terkait dengan Cache dan cookies pada browser ada gunanya, namun ternyata juga banyak efeknya. Berikut ulasan terkait dengan Cache dan Cookies dan cara menghapusnya.&nbsp;</span><br /><span style=\"font-size: small;\">&nbsp;</span><br /><span style=\"font-size: small;\">Cache pada web browser digunakan untuk menyimpan halaman website, gambar atau content download secara sementara pada komputer agar ketika kita akan berpindah halaman akan terasa lebih cepat, karena halaman-halaman website yang sudah pernah di kunjungi akan tersimpan tanpa harus di load ulang saat akan mengaksesnya kembali.</span><br /><br /><span style=\"font-size: small;\">Cookies adalah data yang tersimpan pada komputer ketika kita melakukan login pada email ataupun login pada halaman-halaman website lainnya.</span><br /><br /><span style=\"font-size: small;\">Jika Chace tersimpan terlalu banyak maka akan memperkecil space pada media penyimpanan data /hardisk, kemudian&nbsp; jika Cookies tidak dihapus maka data username serta account suatu email atau data untuk masuk ke halaman admin akan tetap tersimpan, ini dapat membahayakan jika komputer digunakan oleh orang banyak, orang lain bisa saja mengetahui username serta password anda melalui cookies.</span><br /><br /><span style=\"font-size: small;\">Berikut cara &ndash; Cara Menghapus Cache dan Cookies Pada Berbagai Web Browser seperti Mozilla Firefox, Google Chrome, Opera dan Safari :</span><br /><br /><span style=\"font-size: small;\">Cara menghapus Cookies pada browser Mozilla Firefox :</span><br /><br /><span style=\"font-size: small;\">1. Pilih tools menu pada bagian atas browser mozilla, Click &ldquo;Tools&rdquo; -&gt; &ldquo;Options&rdquo;</span><br /><span style=\"font-size: small;\">2. Pilih &ldquo;Privacy&rdquo; pada menu.</span><br /><span style=\"font-size: small;\">3. Pada bagian Firefox will pilih &ldquo;Use custom settings for history&rdquo;</span><br /><span style=\"font-size: small;\">4. Pilih &ldquo;Show Cookies&rdquo;</span><br /><span style=\"font-size: small;\">5. Pilih Cookies yang terdapat pada list yang muncul kemudian klik &ldquo;Remove Cookies&rdquo; untuk menghapus cookies pada list satu persatu namun untuk dapat menghapus semua cookies yang terdaftar anda dapat memilih &ldquo;Remove All Cookies&rdquo;</span><br /><span style=\"font-size: small;\">6. Pilih &ldquo;OK atau Close&rdquo;</span><br /><br /><span style=\"font-size: small;\">CARA CEPAT = Tekan ( Ctrl + Shift + Del )</span><br /><br /><span style=\"font-size: small;\">Cara menghapus Cache pada browser Mozilla Firefox :</span><br /><br /><span style=\"font-size: small;\">1. Pilih tools menu pada bagian atas browser mozilla, Click &ldquo;Tools&rdquo; -&gt; &ldquo;Options&rdquo;</span><br /><span style=\"font-size: small;\">2. Pilih &ldquo;Advance&rdquo; pada menu.</span><br /><span style=\"font-size: small;\">3. pilih &ldquo;Network&rdquo; pada bagian sub menu.</span><br /><span style=\"font-size: small;\">4. Pilih &ldquo;Clear Now&rdquo; pada bagian offlone storage</span><br /><span style=\"font-size: small;\">5. Pilih &ldquo;OK atau Close&rdquo;</span><br /><br /><span style=\"font-size: small;\">CARA CEPAT = Tekan ( Ctrl + Shift + Del )</span><br /><br /><span style=\"font-size: small;\">Cara menghapus Chace dan Cookies pada browser Google Chrome :</span><br /><br /><span style=\"font-size: small;\">1. Pilih tombol berbentuk &ldquo;kunci inggris&rdquo; pada sisi kanan atas.</span><br /><span style=\"font-size: small;\">2. Pilih &ldquo;Tools&rdquo;.</span><br /><span style=\"font-size: small;\">3. Pilih &ldquo;Clear Browsing Data&rdquo;.</span><br /><span style=\"font-size: small;\">4. Pilih &ldquo;Cache dan Cookies&rdquo;.</span><br /><span style=\"font-size: small;\">5. Pilih &ldquo;Clear Browsing Data&rdquo;</span><br /><br /><span style=\"font-size: small;\">CARA CEPAT = Tekan ( Ctrl + Shift + Del )</span><br /><br /><span style=\"font-size: small;\">Cara menghapus Cache pada browser Opera :</span><br /><br /><span style=\"font-size: small;\">1. Pilih tanda &ldquo;Opera&rdquo; pada bagian kiri atas.</span><br /><span style=\"font-size: small;\">2. Pilih &ldquo;Settings&rdquo;.</span><br /><span style=\"font-size: small;\">3. Pilih &ldquo;preferences&rdquo;.</span><br /><span style=\"font-size: small;\">4. Pada sub menu preferences silahkan anda pilih &ldquo;Advanced&rdquo;.</span><br /><span style=\"font-size: small;\">5. Pilih &ldquo;History&rdquo;</span><br /><span style=\"font-size: small;\">6. Pilih &ldquo;Empty Now&rdquo; dan &ldquo;Clear&rdquo;</span><br /><span style=\"font-size: small;\">7. &ldquo;Ok&rdquo;</span><br /><br /><span style=\"font-size: small;\">Cara menghapus Cookies pada browser Opera :</span><br /><br /><span style=\"font-size: small;\">1. Pilih tanda &ldquo;Opera&rdquo; pada bagian kiri atas.</span><br /><span style=\"font-size: small;\">2. Pilih &ldquo;Settings&rdquo;.</span><br /><span style=\"font-size: small;\">3. Pilih &ldquo;preferences&rdquo;.</span><br /><span style=\"font-size: small;\">4. Pada sub menu preferences silahkan anda pilih &ldquo;Advanced&rdquo;.</span><br /><span style=\"font-size: small;\">5. Pilih &ldquo;Cookies&rdquo;</span><br /><span style=\"font-size: small;\">6. Pilih &ldquo;Manage Cookies&rdquo;</span><br /><span style=\"font-size: small;\">7. Setelah itu anda tentukan daftar cookies apa saja yang akan di hapus lalu pilih &ldquo;Delete&rdquo;</span><br /><span style=\"font-size: small;\">8. &ldquo;Close&rdquo;</span><br /><br /><span style=\"font-size: small;\">Cara menghapus Cache dan Cookies pada browser Safari :</span><br /><br /><span style=\"font-size: small;\">1. Pilih tanda &ldquo;Gear&rdquo; pada bagian kanan atas.</span><br /><span style=\"font-size: small;\">2. Pilih &ldquo;Preferences&rdquo;.</span><br /><span style=\"font-size: small;\">3. Pada sub menu preferences pilih &ldquo;Privacy&rdquo;.</span><br /><span style=\"font-size: small;\">4. Pilih &ldquo;Remove All Website Data&rdquo; Pada bagian Cookies and other website data.</span><br /><br /><span style=\"font-size: small;\">Semoga membantu.&nbsp;</span></p>', 'cara-menghapus-cache-dan-cookies-pada-berbagai-web-jogja-media-web.jpg', '2016-03-16 10:34:08', 'google.com', 'menghapus-cache--di-web-browser-', 1),
(5, 'Cara memilih Hosting Yang Tepat', '<p style=\"text-align: justify;\"><span>Memilih web hosting adalah gampang-gampang susah. Sepintas mungkin terihat mudah, tetapi sebenarnya itu memerlukan pemahaman yang baik untuk memilih satu yang terbaik. </span></p>\r\n<p style=\"text-align: justify;\"><span>Semakin menjamurnya web hosting di Indonesia membuat kons</span>Menyesuaikan kebutuhan hosting untuk website/blog merupakan salah satu pertimbangan penting dalam berinvestasi dalam hosting. Misalnya, Anda hanya ingin membangun website/blog personal yang hanya berisi beberapa artikel dengan traffic yang tidak terlalu tinggi, maka Anda bisa memilih paket shared hosting.</p>\r\n<p style=\"text-align: justify;\">Sebaliknya, jika Anda ingin membangun website besar dengan jumlah file atau data yang cukup banyak, maka Anda membutuhkan resource yang lebih besar, termasuk disk space, kecep<span>umen dituntut untuk lebih selektif dalam menentukan pilihan, karena semua penyedia web hosting saling berlomba-lomba untuk menawarkan layanan mereka masing-masing, tetapi tidak semua layanan mereka sesuai dengan kebutuhan Anda. Ada beberapa poin yang harus diperhatikan sebelum membeli hosting untuk situs Anda. Berikut 5 tips memilih web hosting yang tepat untuk bisnis Anda.</span></p>\r\n<h2 style=\"text-align: justify;\"><span style=\"font-size: small;\">1. REPUTASI PENYEDIA WEB HOSTING</span></h2>\r\n<p style=\"text-align: justify;\"><span>Ada banyak perusahaan web hosting terkemuka saat ini, akan tetapi tidak semua perusahaan tersebut menjadi pilihan terbaik untuk semua bisnis. Pastikan hanya memilih perusahaan web hosting yang memiliki reputasi baik dan terpercaya. Anda bisa membaca ulasan atau forum-forum online yang membahas tentang web hosting untuk mengetahui reputasi dan kredibilitas perusahaan web hosting.</span></p>\r\n<h2 style=\"text-align: justify;\"><span style=\"font-size: small;\">2. SESUAIKAN DENGAN ANGGARAN ANDA</span></h2>\r\n<p style=\"text-align: justify;\"><span>Ketika membeli sebuah hosting sesuaikan dengan anggaran Anda. Hal ini penting dalam bisnis, karena ketika membeli hosting Anda harus mendapatkan pilihan dan jenis hosting yang menguntungkan, bukan merugikan. Selain baik secara finansial, hal ini juga dapat meningkatkan website atau blog Anda.</span></p>\r\n<h2 style=\"text-align: justify;\"><span style=\"font-size: small;\">3. SESUAIKAN DENGAN KEBUTUHAN WEB/BLOGatan transfer data, dan bandwidth.</span></h2>\r\n<h2 style=\"text-align: justify;\"><span style=\"font-size: small;\">4. FITUR</span></h2>\r\n<p style=\"text-align: justify;\"><span>Untuk memudahkan dalam mengembangkan website atau blog Anda, pilihlah web hosting yang menawarkan fitur lengkap, seperti ketersediaan script auto installer CMS, fitur Add-on domain, sistem keamanan yang baik, dll.</span></p>\r\n<p style=\"text-align: justify;\"><span>Fitur Add-on domain mungkin merupakan salah satu fitur hosting yang cukup penting. Anda bisa menambahkan beberapa domain dalam satu hosting. Artinya, Anda dapat berbagi hosting untuk beberapa website sekaligus. Dari sisi biaya, hal ini tentunya akan lebih ekonomis daripada harus menyewa hosting secara terpisah.</span></p>\r\n<h2 style=\"text-align: justify;\"><span style=\"font-size: small;\">5. LAYANAN PELANGGAN</span></h2>\r\n<p style=\"text-align: justify;\"><span>Terakhir, ini juga merupakan faktor penting yang harus diperhatikan. Pilihlah penyedia web hosting yang memberikan layanan pelanggan yang baik. Hal ini sangat penting terutama bagi pemula untuk membantu mereka menyelesaikan masalah yang berkaitan dengan hosting. Semua pelanggan pastinya ingin mendapatkan respon yang cepat dan tepat ketika dihadapkan dengan suatu permasalahan, baik itu masalah pada server, keamanan, maupun masalah lainnya.</span></p>\r\n<p style=\"text-align: justify;\"><span>Sebuah penyedia web hosting yang baik menyediakan layanan pelanggan yang baik melalui beberapa pilihan, seperti ticket, email, telepon, hingga live chat, dan biasanya mereka tersedia selama 24/7.</span></p>', '7409317.jpg', '2016-04-07 13:21:46', 'www.google.com', 'cara-memilih-hosting-yang-tepat', 1),
(6, 'Tips Membuat Artikel Blog Yang Bagus', '<p style=\"text-align: justify;\">Tidak bisa dipungkiri bahwa perkembangan blogging saat ini telah meningkat pesat dalam beberapa tahun terakhir. Diperkirakan ada lebih dari 50 juta posting baru yang muncul di internet setiap bulannya. Hal ini dikarenakan blog adalah cara yang bagus untuk membangun hubungan dengan pengunjung online dalam konteks non-penjualan dan secara tidak langsung ikut mendorong pertumbuhan informasi di internet. Banyak perusahaan-perusahaan besar dan situs ecommerce yang juga telah memanfaatkan blog sebagai media alternatif untuk berkomunikasi dengan pelanggan.</p>\r\n<p style=\"text-align: justify;\">Konten blog yang baik adalah yang mampu menjawab pertanyaan/memecahkan masalah dan memberikan informasi yang berguna bagi pembacanya. Berikut 7 tips membuat artikel blog yang bagus.</p>\r\n<h2 style=\"text-align: justify;\">1. KENALI AUDIENS/PENGUNJUNGMU</h2>\r\n<p style=\"text-align: justify;\">Sebelum menulis sesuatu, cobalah tanyakan pada diri sendiri dua pertanyaan berikut ini:</p>\r\n<p style=\"text-align: justify;\"><strong>Untuk apa saya menulis ini?</strong></p>\r\n<p style=\"text-align: justify;\">Tujuan orang menulis artikel mungkin untuk mendapatkan lead penjualan, akan tetapi tujuan utama dari blog itu sendiri adalah untuk memberikan informasi kepada pembaca dan memberikan saran untuk memecahkan masalah mereka. Dengan begitu, kamu bisa membangun otoritas dan kepercayaan dengan blog untuk menarik dan mempertahankan pengunjung.</p>\r\n<p style=\"text-align: justify;\"><strong>Siapa target saya?</strong></p>\r\n<p style=\"text-align: justify;\">Sebelum melangkah lebih jauh, pastikan kamu tahu siapa target pengunjungmu. Kenali siapa mereka dan pertahankan mereka ketika sedang menulis. Dengan cara ini kamu bisa mengetahui apa yang membuat mereka tertarik, apa masalah mereka, dan bagaimana membantu memecahkan masalah mereka.</p>\r\n<h2 style=\"text-align: justify;\">2. MEMBANGUN PERCAKAPAN</h2>\r\n<p style=\"text-align: justify;\">Setelah mengenali siapa saja audiensmu, pikirkan bagaimana berbicara dengan mereka. Sebuah blog yang baik adalah yang user-friendly, menarik, dan mudah di navigasi. Bayangkan pengunjung blogmu adalah orang sibuk, sehingga kamu harus menghargai waktu mereka, ringkas, dan mudah dimengerti, ketika kita bisa menggunakan lima kata kenapa harus menggunakan sepuluh kata?</p>\r\n<h2 style=\"text-align: justify;\">3. INFORMATIF</h2>\r\n<p style=\"text-align: justify;\">Banyak pembaca blog dijejali dengan pesan penjualan dari pagi sampai malam. Mereka mungkin akan bertanya-tanya pada diri sendiri \"apa untungnya bagi saya?\". Jadi, pastikan kontenmu berisi informasi yang berguna dan informatif yang memberikan solusi untuk membantu memecahkan masalah mereka.</p>\r\n<h2 style=\"text-align: justify;\">4. BUAT JUDUL YANG MENARIK</h2>\r\n<p style=\"text-align: justify;\">Judul merupakan bagian utama dan paling penting dari sebuah artikel. Ini karena hal pertama yang akan dilihat dan dibaca oleh pengunjung adalah judul. Judul yang menarik akan mendorong pengunjung untuk terus membaca. Buat judul semenarik mungkin yang berhubungan dengan topik blogmu, jangan terlalu panjang juga jangan terlalu singkat. Misalnya, \"7 Tips Membuat Artikel Blog Yang Bagus\".</p>\r\n<h2 style=\"text-align: justify;\">5. TERSTRUKTUR</h2>\r\n<p style=\"text-align: justify;\">Ciri artikel yang bagus adalah terstruktur atau memiliki struktur yang baik. Ini memudahkan pembaca untuk memahami isi blog. Berikut adalah contoh struktur artikel blog yang baik:</p>\r\n<p style=\"text-align: justify;\">- Gunakan sub-judul<br />- Gunakan susunan kata dalam paragraf yang mudah dicerna<br />- Gunakan poin-poin yang mudah dipahami<br />- Gunakan tata bahasa dan ejaan yang baik<br />- Gunakan gambar/audio/video untuk menambah elemen visual yang menarik</p>\r\n<h2 style=\"text-align: justify;\">6. TAMBAHKAN KATA KUNCI (KEYWORD)</h2>\r\n<p style=\"text-align: justify;\">Sebelum menulis, sebaiknya siapkan beberapa daftar kata kunci utama yang berhubungan dengan topik blogmu. Menyertakan kunci dalam judul dan sub judul dapat membantu untuk memperoleh peringkat yang lebih tinggi di mesin pencari. Ingat, tetaplah berhati-hati dalam menuliskan kata kunci dalam blog. Masukkan kata kunci secukupnya atau sewajarnya, karena jika terlalu banyak kata kunci dalam sebuah artikel akan ditandai sebagai spam.</p>\r\n<h2 style=\"text-align: justify;\">7. KONSISTEN</h2>\r\n<p style=\"text-align: justify;\">Terakhir, untuk membuat sebuah blog memang membutuhkan banyak waktu dan energi. Membangun blog yang baik tidak harus dengan membuat posting setiap hari, tetapi konsisten. Kamu bisa membuat artikel dua hari sekali, tiga hari sekali, atau bahkan seminggu sekali. Kamu bisa menggunakan newsletter dan media sosial untuk mempublish setiap posting baru.</p>', '4615588.jpg', '2016-04-07 13:28:27', 'google.com', 'tips-membuat-artikel-blog-yang-bagus', 1),
(7, 'Membuat Website Dengan Bootstrap', '<div style=\"text-align: justify;\"><strong>APA ITU BOOTSTRAP ?</strong></div>\r\n<div style=\"text-align: justify;\"><span><span><span class=\"a\"><br /></span></span></span><span><span><span class=\"a\">&nbsp; &nbsp; &nbsp; Bootstrap adalah sebuah framework CSS&nbsp;</span><span class=\"a\">yang menyediakan kumpulan komponen-</span><span class=\"a\">komponen antarmuka dasar pada web yang&nbsp;telah&nbsp;</span><span class=\"a\">dirancang sedemikian rupa&nbsp;untuk digunakan&nbsp;</span><span class=\"a\">bersama-sama. Selain komponen antarmuka, Bootstrap juga&nbsp;menyediakan sarana untuk</span><span class=\"a\">membangun</span></span></span><span><span>layout&nbsp;</span></span><span><span><span class=\"a\">halaman dengan mudah dan rapi,&nbsp;serta modifikasi pada tampilan dasar&nbsp;</span><span class=\"a\">HTML untuk membuat seluruh halaman web yang dikembangkan senada dengan komponen-</span><span class=\"a\">komponen lainnya.</span></span></span><span><span><span><span><span class=\"a\">Bootstrap dibuat untuk&nbsp;memberikan&nbsp;</span></span></span><span class=\"a\">sekumpulan perangkat yang dapat diguna</span></span></span><span><span><span class=\"a\">kan untuk membangun website sederhana&nbsp;dengan&nbsp;</span></span></span><span class=\"a\"><span><span>mudah.</span></span></span><br /><strong><br /></strong><strong>Bagaimana Cara instalasi Bootstrap ?</strong></div>\r\n<div style=\"text-align: justify;\"><span><span><span class=\"a\">&nbsp; &nbsp;</span></span></span><br /><span><span><span class=\"a\">&nbsp; &nbsp; Untuk menggunakan Boostrap pada aplikasi kita,&nbsp;</span><span class=\"a\">tentunya kita harus memiliki Bootstrap terlebih&nbsp;</span><span class=\"g\"><span class=\"a\">dahulu. Buka website resmi Bootstrap,&nbsp;</span><span class=\"a\"><a href=\"http://getbootstrap.com/\">http://getbootstrap.com/</a>&nbsp;</span></span></span><span><span class=\"a\">dan klik tombol \"Download Bootstrap\" untuk memulai download bootstrap.</span></span></span></div>', '70139123.jpg', '2016-04-14 14:07:06', 'http://pengertianbootstrap.blogspot.co.id/', 'membuat-website-dengan-bootstrap', 1),
(8, 'Langkah - Langkah Memulai Bisnis Online Bagi Pemula', '<p style=\"text-align: justify;\">Apakah Anda saat ini sedang berusaha mencari cara untuk memulai bisnis online dan ingin mendapatkan penghasilan tambahan?</p>\r\n<p style=\"text-align: justify;\">Atau, apakah Anda ingin memang benar-benar ingin fokus menerjuni jalur bisnis online sebagai sarana untuk mendapatkan sumber penghasilan utama?</p>\r\n<p style=\"text-align: justify;\">Tenang. Anda tidak sendirian&hellip;</p>\r\n<p style=\"text-align: justify;\">Banyak orang-orang di luaran sana yang sedang melakukan hal serupa. Termasuk saya&hellip;</p>\r\n<p style=\"text-align: justify;\">Bagi kita yang masih baru memulai, sebelum kita membahas lebih lanjut, ada baiknya kita coba definiskan dulu apa itu bisnis online.</p>\r\n<p style=\"text-align: justify;\">Menurut saya, bisnis apapun yang dijalankan menggunakan media internet bisa dikatakan BISNIS ONLINE. Jadi arti BISNIS ONLINE itu sendiri memang bisa sangat luas.</p>\r\n<p style=\"text-align: justify;\">Jika kita sudah punya bisnis yang dijalankan secara offline, seperti buka toko baju, toko makanan, toko mainan, atau apapun, kemudian kita buka juga di internet, itu bisa menjadi bisnis online.</p>\r\n<p style=\"text-align: justify;\">Baca: pengertian bisnis online<br />Nah, disini saya ingin berbagi pengalaman tentang bagaimana mengawali usaha melalui internet, plus langkah-langkah yang diperlukan ketika memulai bisnis online, yakni hal-hal inti yang penting untuk dilakukan supaya usaha Anda bisa langsung dijalankan.</p>\r\n<p style=\"text-align: justify;\">&ldquo;Untuk itu, ijinkan saya bercerita&hellip;&rdquo;</p>\r\n<p style=\"text-align: justify;\">Flashback: Dimulai Pada Tahun 2009</p>\r\n<p style=\"text-align: justify;\">Saya masih ingat, dulu waktu pertama kali memulai bisnis online segala sesuatunya tampak seperti absurd. Banyak keraguan&hellip;</p>\r\n<p style=\"text-align: justify;\">Lalu, muncul lah pertanyaan-pertanyaan di dalam diri seperti:</p>\r\n<p style=\"text-align: justify;\">Bisa nggak ya bisnis online itu dijalankan?<br />Cocok apa nggak ya buat saya lakukan?<br />Langkah apa saja yang perlu saya tempuh supaya bisa jalan?<br />Berapa modal yang akan dibutuhkan?<br />&hellip; dan segudang pertanyaan lainnya.<br />Meskipun tidak ada patokan pasti langkah-langkah apa yang sebenarnya harus dilakukan, menurut saya secara singkat ada tiga hal utama yang bisa kita persiapkan. Apa saja langkah-langkah tersebut?</p>\r\n<p style=\"text-align: justify;\">Tetaplah menyimak&hellip;</p>\r\n<p style=\"text-align: justify;\">Langkah Pertama..</p>\r\n<p style=\"text-align: justify;\">riset produk, bisnis onlinePertama-tama adalah putuskan apa yang mau Anda jual.</p>\r\n<p style=\"text-align: justify;\">Sebelum benar-benar menjalani suatu siklus bisnis, Anda harus berlatih menjual lewat internet terlebih dahulu. Kira-kira apa yang mau Anda tawarkan ke orang lain lewat media online.</p>\r\n<p style=\"text-align: justify;\">Carilah apa yang dibutuhkan oleh masyarakat. Carilah apa yang dibutuhkan oleh orang-orang di sekitar Anda.</p>\r\n<p style=\"text-align: justify;\">Anda adalah problem solver, Anda adalah pemberi solusi dari permasalahan orang-orang.</p>\r\n<p style=\"text-align: justify;\">Kebanyakan orang salah langkah pada tahapan ini. Mereka terlalu berfokus pada produknya dulu, bukan pada kebutuhan orang-orang. Sehingga bahkan banyak yang tumbang sebelum mencapai penjualan pertama.</p>\r\n<p style=\"text-align: justify;\">Untuk itu saya sarankan lakukanlah riset produk, dan sebisa mungkin carilah produk-produk yang cepat laku dan perputarannya cepat. Artinya banyak yang membutuhkan atau ada pasarnya. Sehingga kita bisa ikut semangat dalam menjalani kegiatan jualan online ini.</p>\r\n<p style=\"text-align: justify;\">Bukan apa-apa sih, tetapi kalau produk kita yang membutuhkan terlalu sedikit atau pasarnya sempit, biasanya kita akan mudah menyerah karena dagangan tidak kunjung laku. *pengalaman pribadi* ðŸ™‚</p>\r\n<p style=\"text-align: justify;\">Mengenai jenis produknya, bisa berbentuk produk fisik, jasa, ataupun digital.</p>\r\n<p style=\"text-align: justify;\">Contoh barang fisik, sabun herbal, obat herbal, jam tangan, smartphone, motor, mobil, makanan, pernak-pernik aksesoris, rumah dan bangunan, dan apa saja yang bisa Anda tangkap.<br />Contoh barang digital, bisa berupa ebook, produk-produk informasi, kursus online, software.<br />Contoh jasa, bisa dengan menyediakan jasa pembuatan website, jasa online marketing, rental mobil, agen tour &amp; travel, agen umroh &amp; haji, dan jasa-jasa yang lain.<br />Tidak usah terlalu detil, yang penting Anda mempunyai gambaran besar mengenai rencana Anda dan memahami pola pemasaran online.</p>\r\n<p style=\"text-align: justify;\">Nah, berdasarkan pengalaman saya juga, langkah pertama ini adalah yang terberat.</p>\r\n<p style=\"text-align: justify;\">Mengapa?</p>\r\n<p style=\"text-align: justify;\">Karena kita harus menyusun konsep usaha, mencari ide, mencari supplier, dan bahkan mau nggak mau juga harus belajar ilmu bisnis.</p>\r\n<p style=\"text-align: justify;\">Biasanya hambatan yang muncul pada fase ini adalah, kadang kita menginginkan segala sesuatu sempurna. Dan bsia ditebak, akhirnya malah nggak jalan-jalan.</p>\r\n<p style=\"text-align: justify;\">Kalau saya boleh memberi masukan, untuk tahap awal ini Anda tidak usah terlalu detil dulu. Anda harus rela untuk menginvestasikan waktu, tenaga, dan mungkin uang, UNTUK BELAJAR.</p>\r\n<p style=\"text-align: justify;\">Mulailah dengan menjual produk orang lain, bisa dengan konsep dropship, reseller, kemitraan dengan produsen, atau sebagai afiliasi produk suatu vendor (affiliate marketing).</p>\r\n<p style=\"text-align: justify;\">Contohnya: agen asuransi, agen perumahan &amp; properti, agen travel, jual baju / produk fashion dengan konsep konsinyasi, jual ebook orang lain, jual aplikasi software suatu vendor, dll.. dll.. banyak banget.</p>\r\n<p style=\"text-align: justify;\">Sehingga pada tahap awal ini Anda tidak dibebani dengan biaya produksi yang besar dan kerugian pun bisa minimal.</p>\r\n<p style=\"text-align: justify;\">Langkah Kedua..</p>\r\n<p style=\"text-align: justify;\">buat-website-bisnisTahapan selanjutnya adalah membuat lapak online.</p>\r\n<p style=\"text-align: justify;\">Ini adalah tempat kita jualan online atau berpromosi di internet.</p>\r\n<p style=\"text-align: justify;\">Untuk tahapan ini kita bisa memulai dari situs social media, aplikasi social chat, dan situs marketplace.</p>\r\n<p style=\"text-align: justify;\">Contohnya bisa lewat Facebook, Twitter, Instagram, Pinterest, BBM, LINE, Bukalapak, Tokopedia, dan OLX.</p>\r\n<p style=\"text-align: justify;\">Mengapa? Karena itu gratis dan bisa langsung kita manfaatkan untuk promosi dan jualan tanpa harus membuat sistem website nya, tampilannya, dan lain sebagainya.</p>\r\n<p style=\"text-align: justify;\">Pilih channel yang sekiranya Anda nyaman dan kuasai, syukur-syukur bisa pakai semuanya. Tetapi kalau belum bisa ya saran saya minimal pelajari yang Facebook, Instagram, dan BBM.</p>\r\n<p style=\"text-align: justify;\">Dan ketika Anda ingin lebih serius, Anda bisa mulai membuat website sendiri.</p>\r\n<p style=\"text-align: justify;\">Nantinya, website ini akan kita jadikan sebagai lapak online atau workshop RESMI kita di dunia maya.</p>\r\n<p style=\"text-align: justify;\">Dan enaknya lagi, kalau kita sudah memiliki website, ini bisa kita jadikan sebagai pusat tempat rujukan ketika kita hendak menyebar promosi online lewat social media, forum, marketplace, ataupun situs jualan lainnya.</p>\r\n<p style=\"text-align: justify;\">Jadi kalau kita pasang status di social media, forum, dll, kan jadi lebih keren kalau di bagian bawah status tersebut kita kasih link menuju situs kita. Hehe, betul??</p>\r\n<p style=\"text-align: justify;\">Kadang ini juga bisa dijadikan parameter apakah seseorang itu serius dalam menjalani bisnis online atau tidak. Dengan memiliki website, biasanya orang lain akan menjadi lebih mantab ketika hendak bertransaksi dengan kita.</p>\r\n<p style=\"text-align: justify;\">Dalam proses pembuatan website, Anda akan lebih banyak berkutat dengan hal-hal yang sifatnya teknis, seperti belajar menginstal aplikasi website, dan mungkin sedikit belajar bahasa pemrograman web.</p>\r\n<p style=\"text-align: justify;\">Tidak perlu khawatir, jangan buru-buru bilang &ldquo;saya gaptek&rdquo;, &ldquo;nggak ngerti teknologi&rdquo;, &ldquo;saya bukan anak kuliahan&rdquo;, dan kata-kata sejenis lainnya.</p>\r\n<p style=\"text-align: justify;\">Karena website yang akan kita buat adalah jenis website yang praktis, nggak pakai ribet. Istilah kerennya, tinggal &ldquo;plug and play&rdquo;&hellip; pasang lalu pakai&hellip;</p>\r\n<p style=\"text-align: justify;\">Lagipula, disinilah tantangannya dalam berbisnis online.</p>\r\n<p style=\"text-align: justify;\">Selanjutnya, kita akan membutuhkan nama domain dan hosting untuk membuat website.</p>\r\n<p style=\"text-align: justify;\">Lalu apa itu domain? Dan apa itu hosting?</p>\r\n<p style=\"text-align: justify;\">Domain adalah nama website Anda, contoh: www.usahasaya.com.<br />Hosting adalah tempat untuk menaruh nama domain Anda dan file-file pembentuk website.<br />Ibarat bangunan toko, nama domain adalah alamat toko Anda. Jadi usahakan ketika Anda memutuskan untuk membuat nama domain, sesuaikan dengan nama Anda, atau topik website Anda, ataupun jenis usaha Anda.</p>\r\n<p style=\"text-align: justify;\">Dan untuk hosting, jika menggunakan analogi bangunan toko di atas, hosting itu ibarat tanah. Semakin besar kapasitas hosting, maka akan semakin luas pula ukuran tanah toko Anda.</p>\r\n<p style=\"text-align: justify;\">Jadi harus diingat, domain dan hosting merupakan satu kesatuan, dan tidak bisa dipisahkan untuk membangun sebuah website.</p>\r\n<p style=\"text-align: justify;\">Gunakan kata-kata yang memang pantas untuk Anda tampilkan di website. Karena ini akan menjadi sarana promosi dan kantor online Anda.</p>\r\n<p style=\"text-align: justify;\">Untuk materi konten web-nya, tampilkan yang simpel-simpel saja dulu, dan sebisa mungkin memuat informasi sebagai berikut:</p>\r\n<p style=\"text-align: justify;\">Profil usaha.<br />Galeri gambar produk / jasa beserta keterangannya.<br />Alamat usaha lengkap dengan cara menghubungi Anda.<br />Cara pemesanan dan form order nya.<br />Promosikan&hellip;</p>\r\n<p style=\"text-align: justify;\">promosi bisnis online</p>\r\n<p style=\"text-align: justify;\">Ya, kalau konten website sudah ada, apalagi selanjutnya kalau bukan mempromosikan website bisnis Anda. Tujuannya adalah untuk mendapatkan kunjungan / trafik ke website kita.</p>\r\n<p style=\"text-align: justify;\">Anda bisa memulainya dengan memanfaatkan situs social media seperti Facebook, Twitter, Instagram, Pinterest, dan situs social media lain yang Anda paham.</p>\r\n<p style=\"text-align: justify;\">Setahu saya, ini adalah cara tercepat untuk menyebarluaskan informasi bisnis Anda. Apalagi jika Anda mempunyai jumlah teman / follower yang sudah cukup banyak, itu akan sangat membantu.</p>\r\n<p style=\"text-align: justify;\">Kemudian, Anda juga bisa mulai memajang produk maupun jasa Anda di situs-situs forum seperti Kaskus, dan situs-situs Marketplace seperti Bukalapak, Toko Bagus (sekarang OLX.CO.ID), Tokopedia, dll.</p>\r\n<p style=\"text-align: justify;\">Selain itu, untuk tingkat promosi yang lebih &ldquo;Advance&rdquo;, yakni melalui mesin pencari seperti Google, Yahoo, Bing dengan teknik SEO.</p>\r\n<p style=\"text-align: justify;\">Ini memang lebih teknis, karena kita harus memahami cara optimasi situs supaya bisa menduduki halaman pertama dalam suatu mesin pencari, dengan kata kunci tertentu. Namun justru dengan memahami pola SEO ini, mindset bisnis dan pemasaran online kita akan lebih tajam.</p>\r\n<p style=\"text-align: justify;\">Ohya, seperti yang tadi saya singgung di &ldquo;Langkah Kedua &ndash; Membuat Website&rdquo;. Website yang kita buat tadi akan kita jadikan sebagai pusat rujukan dari promosi online yang kita lakukan.</p>\r\n<p style=\"text-align: justify;\">Maksudnya, setelah orang-orang mendapatkan informasi tentang produk / jasa Anda dari situs social media, forum, marketplace, maupun Google dan mesin pencari lainnya, tentunya mereka penasaran siapa sih yang jualan produk / jasa tersebut. Dan pada akhirnya mereka akan mengunjungi situs Anda untuk mendapatkan info lebih dalam tentang siapa Anda dan apa saja produk Anda.</p>\r\n<p style=\"text-align: justify;\">Ini momentum! Jangan sampai kita kehilangan prospek karena kita tidak punya &ldquo;kantor online&rdquo; disebabkan oleh kurang percayanya calon konsumen terhadap presensi online kita.</p>\r\n<p style=\"text-align: justify;\">Apa itu? Ya, website yang baru saja kita buat&hellip;</p>\r\n<p style=\"text-align: justify;\">Jadi benar-benar manfaatkan momentum ini untuk memberikan respon yang meyakinkan.</p>\r\n<p style=\"text-align: justify;\">Selanjutnya, bangun hubungan dengan para pengunjung, beri informasi yang mereka butuhkan. Mungkin mereka tidak langsung beli produk Anda, namun ketika mereka mendapatkan informasi yang dibutuhkan, maka kepercayaan mereka akan tumbuh, sehingga kemungkinan mereka membeli produk pada Anda akan semakin besar.</p>\r\n<p style=\"text-align: justify;\">Target utama dari pemanfaatan website kita, adalah terjadinya kontak pertama dengan calon konsumen. Selanjutnya, itu terserah Anda. Mau pakai follow up by email kah, by phone kah, atau kunjungan langsung on the spot kah, silahkan.</p>', '666281Untitled-1.jpg', '2016-05-09 10:49:54', 'https://i0.wp.com/webhostmu.com/media/bisnis-online.png?resize=602%2C376&ssl=1', 'langkah--langkah-memulai-bisnis-online-bagi-pemula', 1),
(9, 'Pengertian Website', 'Pengertian website dan jenisnya â€“ Website adalah sering juga disebut Web, dapat diartikan suatu kumpulan-kumpulan halaman yang menampilkan berbagai macam informasi teks, data, gambar diam ataupun bergerak, data animasi, suara, video maupun gabungan dari semuanya, baik itu yang bersifat statis maupun yang dinamis, yang dimana membentuk satu rangkaian bangunan yang saling berkaitan dimana masing-masing dihubungkan dengan jaringan halaman atau hyperlink.\r\n\r\nAtau definisi website adalah kumpulan dari berbagai macam halaman situs, yang terangkum didalam sebuah domain atau juga subdomain, yang lebih tempatnya berada di dalam WWW (World Wide Web) yang tentunya terdapat di dalam Internet. Halaman website biasanya berupa dokumen yang ditulis dalam format Hyper Text Markup Language (HTML), yang bisa diakses melalui HTTP, HTTP adalah suatu protokol yang menyampaikan berbagai informasi dari server website untuk ditampilkan kepada para user atau pemakai melalui web browser.\r\n\r\nJenis atau macam-macam website\r\n\r\nJenis-jenis website ada 3 (tiga) macam diantaranya, bisa dibaca dibawah ini:\r\n\r\n    Website Statis adalah suatu website yang mempunyai halaman yang tidak berubah. Yang artinya adalah untuk melakukan sebah perubahan pada suatu halaman hanya bisa dilakukan secara manual yitu dengan cara mengedit kode-kode yang menjadi struktur dari website itu sendiri.\r\n    Website Dinamis adalah merupakan suatu website yang secara strukturnya diperuntukan untuk update sesering mungkin. Biasanya selain dimana utamanya yang bisa diakses oleh para pengguna (user) pada umumnya, juga telah disediakan halaman backend yaitu untuk mengedit kontent dari website tersebut. Contoh dari website dinamis seperti web berita yang didalamnya terdapat fasilitas berita, dsb.\r\n    Website Interaktif adalah suatu website yang memang pada saat ini memang terkenal. Contohnya website interaktif seperti forum dan blog. Di website ini para pengguna bisa berinteraksi dan juga beradu argument mengenai apa yang menjadi pemikiran mereka.\r\n\r\npengertian website\r\n\r\nApakah itu website?\r\n\r\nInilah manfaat website\r\n\r\nManfaat dari website biasanya sebagaian orang memiliki suatu alasan untuk membuat web itu sendiri, diantaranya:\r\n\r\n    Memperluas jangkauan promosisesuatu, dengan memiliki website maka produk kita lebih bisa dikenal oleh masyarakat khususnya pengguna internet.\r\n    Bisa menjadi media tanpa batas, sebab internet adalah media informasi yang tanpa batas. Dengan memiliki website kita berarti sama saja memiliki banayk karyawan yang mempromosikan produk kita selama 24 jam. Yang artinya diman website kita akan memberikan suatu informasi kepada calon konsumen selama 24 jam.\r\n    Promosi yang luas, internet adalah suatu media promosi terluas di dunia jika dilihat dari jangkauan area.\r\n    Media pengenalan perusahaan, Jika kita memeliki suatu perusahaan akan lebih mudah kita mengenalkan perusahaan lewat website, kerana jangkauannya internet yang luas dan pemakainya yang banyak, sehingga perusahaan kita akan dikenaloleh masyarakat banyak sehingga dapat mendatangkan calon konsumen dengan cara promosi produk lewat website.\r\n    Dan lain-lain.\r\n\r\nMacam-macam domain website\r\n\r\nDomain website, contohnya bisa di baca di bawah ini:\r\n\r\n    .co.id : Biasanya digunakan untuk badan usaha yang memiliki badan hukum sah.\r\n    .go.id : Khusus digunakan untuk Lembaga Pemerintahan  RI.\r\n    .ac.id : Dipakai untuk Lembaga Pendidikan.\r\n    .or.id: Dipakai untuk segala macam organisasi yang tidak termasuk kedalam kategori â€co.idâ€,â€go.idâ€,â€mil.idâ€, â€œac.idâ€ dan sebagainya.\r\n    .war.net.id : Dipaki untuk industri warung internet (warnet) yang ada di Indonesia\r\n    .sch.id: Dipakai khusus untuk Lembaga Pendidikan SD, SMP dan SMU atau SMK\r\n    .web.id: Biasanya digunakan untuk organisasi, badan usaha, ataupun perseorangan yang melakukan kegiatannya di WWW.\r\n\r\nItulah secara singkat mengenai pengertian website, semoga dapat bermanfaat dalam menambah ilmu pengetahuan.', 'ruang-programmer-714649how-to-start-a-website.jpg', '2016-05-31 20:11:46', 'google.com', 'pengertian-website', 1),
(10, 'Pengertian HTML', 'HTML adalah bahasa markup internet (web) berupa kode dan simbol yang dimasukkan kedalam sebuah file yang ditujukan untuk ditampilkan didalam sebuah website. Singkatnya, HTML adalah bahasa markup yang digunakan untuk membuat website. Website yang dibuat dengan HTML ini, dapat dilihat oleh semua orang yang terkoneksi dengan internet. Tentunya dengan menggunakan aplikasi penjelajah internet (browser) seperti Internet Explorer, Mozilla Firefox dan Google Chrome. Seperti yang sudah saya jelaskan sebelumnya, HTML adalah singkatan dari Hyper Text Markup Language. Tapi mengetahui singkatannya saja tidak akan cukup. Karena itu saya akan menyajikan arti dari kata kata tersebut. HyperText adalah metode dimana kita \"berpindah\" disekeliling web, dengan mengeklik sebuah teks yang bernama hyperlink. Hyperlink adalah sebuah teks khusus di internet, dimana saat teks tersebut diklik, akan membawa kita ke halaman web selanjutnya/halaman web lain yang telah ditentukan. Markup adalah hal yang dilakukan oleh tag HTML kepada teks yang ada didalamnya. HTML menandai teks yang berada didalamnya sebagai tipe teks tertentu. Misalnya saja jika kita menandai sebuah teks dengan tag html , maka teks tersebut akan berubah menjadi italic (huruf yang miring). Sedangkan jika kita menandainya dengan , maka teks tersebut akan berubah menajadi bold (huruf tebal). Language yang berarti bahasa. HTML adalah sebuah bahasa, yang memiliki kata kata berupa kode dan syntax seperti bahasa yang lain. Saat ini bahasa HTML masih terus dikembangkan Hal ini dikarenakan pengguna internet semakin hari semakin berkembang pesat. Oleh karena itu bahasa HTML harus ditingkatkan lagi agar bisa menciptakan halaman web yang lebih berkualitas. Untuk itulah dibentuk sebuah organisasi yang bertanggungjawab mengembangkan bahasa HTML. Organisasi ini bernama W3C.\r\n\r\nDisalin dari : http://www.burung-net.com/2015/05/pengertian-html-fungsi-html-serta-sejarah-html.html\r\nHargai penulis, jangan hapus sumber ini. ', 'ruang-programmer-667235pengertian html fungsi html sejarah html.jpg', '2016-05-31 20:22:43', 'google.com', 'pengertian-html', 1),
(11, 'Pengertian CSS', 'Cascading Style Sheets (CSS) adalah suatu bahasa stylesheet yang digunakan untuk mengatur tampilan suatu dokumen yang ditulis dalam bahasa markup. Penggunaan yang paling umum dari CSS adalah untuk memformat halaman web yang ditulis dengan HTML dan XHTML. Walaupun demikian, bahasanya sendiri dapat dipergunakan untuk semua jenis dokumen XML termasuk SVG dan XUL. Spesifikasi CSS diatur oleh World Wide Web Consortium (W3C).\r\n\r\nCSS digunakan oleh penulis maupun pembaca halaman web untuk menentukan warna, jenis huruf, tata letak, dan berbagai aspek tampilan dokumen. CSS digunakan terutama untuk memisahkan antara isi dokumen (yang ditulis dengan HTML atau bahasa markup lainnya) dengan presentasi dokumen (yang ditulis dengan CSS). Pemisahan ini dapat meningkatkan aksesibilitas isi, memberikan lebih banyak keleluasaan dan kontrol terhadap tampilan, dan mengurangi kompleksitas serta pengulangan pada stuktur isi.\r\n\r\nCSS memungkinkan halaman yang sama untuk ditampilkan dengan cara yang berbeda untuk metode presentasi yang berbeda, seperti melalui layar, cetak, suara (sewaktu dibacakan oleh browser basis-suara atau pembaca layar), dan juga alat pembaca braille. Halaman HTML atau XML yang sama juga dapat ditampilkan secara berbeda, baik dari segi gaya tampilan atau skema warna dengan menggunakan CSS.', 'ruang-programmer-912840pengertian-css.png', '2016-05-31 20:26:15', 'google.com', 'pengertian-css', 1),
(12, 'Pengertian AJAX', 'AJAX adalah singkatan dari Asynchronous JavaScript And XML. AJAX merupakan teknik baru di dunia pengembanan halaman web yang berguna untuk membuat aplikasi web, yang lebih â€œkayaâ€ dibandingkan dengan aplikasi web biasa.\r\nApa triknya sehingga AJAX bisa membuat halaman web yang lebih kaya? Jawabannya adalah Ajax memungkinkan sebuah halaman web memperbarui data dari server yang ditampilkannya tanpa harus melakukan refresh, sehingga halaman terlihat lebih responsif.\r\nFitur dan ciri utama AJAX adalah sebuah halaman web tidak perl di-refresh setiap kali ada data baru yang ingin ditampilkan. Dengan demikian, sebuah aplikasi web akan terasa seperti aplikasi desktop saja. kecepatan, interaktivis, fungsionalitas, dan tingkat kegunaan halaman web akan meningkat.\r\nDari namanya, terlihat bahwa AJAX bersifat asynchronous. Arti asinkron di sini bahwa permintaan data tambahan dari server dan loadingnya dilakukan di background tanpa mempengaruhi tampilan dan sifat halaman web sekarang. Jadi, sembari AJAX bekerja mengambil data dari server, user yang membuka halaman web masih tetap bisa berinteraksi dengan alaman web tersebut, di mana halaman web tidak mengalami freezing seperti halnya aplikasi web konvensional.\r\nSekarang mungkin anda bertanya apakah AJAX itu sebuah bahasa pemrograman baru? bukan, AJAX sebenarnya bukan bahasa pemrograman baru, karena ternyata bahasa yang digunakan oleh AJAX adalah bahasa JavaScript yang sudah cukup berumur.', 'ruang-programmer-558955pengertian-AJAX.png', '2016-05-31 20:29:00', 'google.com', 'pengertian-ajax', 1);
INSERT INTO `berita` (`id`, `judul`, `isi`, `gambar`, `tgl_posting`, `sumber_gambar`, `judul_seo`, `status`) VALUES
(13, 'Pengertian JavaScript', '<div style=\"text-align: justify;\"><strong><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a></strong> adalah bahasa pemograman web yang bersifat Client Side Programming Language. Client Side Programming Language adalah tipe bahasa pemograman yang pemrosesannya dilakukan oleh client. Aplikasi client yang dimaksud merujuk kepada web browser seperti <strong><em>Google Chrome</em></strong> dan <strong><em>Mozilla Firefox</em></strong>.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Jenis bahasa pemograman Client Side berbeda dengan bahasa pemograman Server Side seperti <strong><a href=\"http://www.tutorialku.net/category/tutorial-php/1.xhtml\" target=\"_blank\" rel=\"nofollow\">PHP</a></strong>, dimana untuk server side seluruh kode program dijalankan di sisi server.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Untuk menjalankan <strong><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a></strong>, kita hanya membutuhkan aplikasi text editor, dan web browser. <a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\"><strong>JavaScript</strong></a> memiliki fitur: high-level programming language, client-side, loosely tiped, dan berorientasi objek.</div>\r\n<p>&nbsp;</p>\r\n<h3 style=\"text-align: justify;\">Fungsi JavaScript Dalam Pemograman Web</h3>\r\n<div style=\"text-align: justify;\"><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a> pada awal perkembangannya berfungsi untuk membuat interaksi antara user dengan situs web menjadi lebih cepat tanpa harus menunggu pemrosesan di web server. Sebelum <a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">javascript</a>, setiap interaksi dari user harus diproses oleh <em>web server</em>.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Bayangkan ketika kita mengisi form registrasi untuk pendaftaran sebuah situs web, lalu men-klik tombol submit, menunggu sekitar 20 detik untuk website memproses isian form tersebut, dan mendapati halaman yang menyatakan bahwa terdapat kolom form yang masih belum diisi.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Untuk keperluan seperti inilah <strong><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a></strong> dikembangkan. Pemrosesan untuk mengecek apakah seluruh form telah terisi atau tidak, bisa dipindahkan dari web server ke dalam web browser.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Dalam perkembangan selanjutnya, <a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a> tidak hanya berguna untuk validasi form, namun untuk berbagai keperluan yang lebih modern. Berbagai animasi untuk mempercantik halaman web, fitur chatting, efek-efek modern, games, semuanya bisa dibuat menggunakan JavaScript.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Akan tetapi karena sifatnya yang dijalankan di sisi client yakni di dalam <strong><span style=\"color: #cc0000;\">web browser</span></strong> yang digunakan oleh pengunjung situs, user sepenuhnya dapat mengontrol eksekusi <strong><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a></strong>. Hampir semua <em>web browser</em> menyediakan fasilitas untuk mematikan <a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a>, atau bahkan mengubah kode <strong><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a></strong> yang ada. Sehingga kita tidak bisa bergantung sepenuhnya kepada <em><strong><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a></strong></em>.</div>\r\n<p>&nbsp;</p>\r\n<h3 style=\"text-align: justify;\">Perkembangan JavaScript Saat Ini</h3>\r\n<div style=\"text-align: justify;\">Dalam perkembangannya, <strong><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a></strong> mengalami permasalahan yang sama seperti kode pemograman web yang bersifat client side seperti <a href=\"http://www.tutorialku.net/category/belajar-css/1.xhtml\" target=\"_blank\" rel=\"nofollow\">CSS</a>, yakni bergantung kepada implementasi web browser.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Kode <strong><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a></strong> yang kita buat, bisa saja tidak bekerja di <em>Internet Explorer</em>, karena web browser tersebut tidak mendukungnya. Sehingga programmer harus bekerja extra untuk membuat kode program agar bisa &ldquo;mengakali&rdquo; dukungan dari web browser.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Karena hal tersebut, <strong><a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a></strong> pada awalnya termasuk bahasa pemograman yang rumit, karena harus membuat beberapa kode program untuk berbagai web browser.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Namun, beberapa tahun belakangan ini, <a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a> kembali bersinar berkat kemudahan yang ditawari oleh komunitas programmer yang membuat library JavaScript seperti jQuery. Library ini memudahkan kita membuat program JavaScript untuk semua web browser, dan membuat fitur-fitur canggih yang sebelumnya membutuhkan ribuan baris kode program menjadi sederhana.</div>\r\n<p>&nbsp;</p>\r\n<div style=\"text-align: justify;\">Kedepannya, <a href=\"http://www.tutorialku.net/category/belajar-javascript/1.xhtml\" target=\"_blank\" rel=\"nofollow\">JavaScript</a> akan tetap menjadi kebutuhan programmer, apalagi untuk situs saat ini yang mengharuskan punya banyak fitur modern sebagai standar.</div>\r\n<div style=\"text-align: justify;\">sumber : http://www.tutorialku.net/pengertian-dan-fungsi-javascript-dalam-dunia-pemograman.xhtml</div>', 'ruang-programmer-239534javascript-maskolis.png', '2016-05-31 20:34:24', 'google.com', 'pengertian-javascript', 1),
(14, 'Pengertian PHP', '<p><a class=\"external text\" href=\"http://www.php.net/\" rel=\"nofollow\">PHP</a> adalah singkatan dari \"PHP: Hypertext Prepocessor\", yaitu bahasa pemrograman yang digunakan secara luas untuk penanganan pembuatan dan pengembangan sebuah <a class=\"extiw\" title=\"w:situs web\" href=\"https://id.wikipedia.org/wiki/situs_web\">situs web</a> dan bisa digunakan bersamaan dengan <a class=\"new\" title=\"HTML (halaman belum tersedia)\" href=\"https://id.wikibooks.org/w/index.php?title=HTML&amp;action=edit&amp;redlink=1\">HTML</a>. PHP diciptakan oleh Rasmus Lerdorf pertama kali tahun 1994. Pada awalnya PHP adalah sinngkatan dari \"Personal Home Page Tools\". Selanjutnya diganti menjadi FI (\"Forms Interpreter\"). Sejak versi 3.0, nama bahasa ini diubah menjadi \"PHP: Hypertext Prepocessor\" dengan singkatannya \"PHP\". PHP versi terbaru adalah versi ke-5. Berdasarkan survey Netcraft pada bulan Desember 1999, lebih dari sejuta site menggunakan PHP, di antaranya adalah NASA, Mitsubishi, dan RedHat.</p>', 'ruang-programmer-165086php-ilmuweb.net_.png', '2016-05-31 20:36:35', 'google.com', 'pengertian-php', 1),
(15, 'Pengertian Basis Data', '<p><strong>Pangkalan data</strong><sup id=\"cite_ref-pangkalan_data_1-0\" class=\"reference\"><a href=\"https://id.wikipedia.org/wiki/Basis_data#cite_note-pangkalan_data-1\">[1]</a></sup> atau <strong>basis data</strong> (<a title=\"Bahasa Inggris\" href=\"https://id.wikipedia.org/wiki/Bahasa_Inggris\">bahasa Inggris</a>: <em>database</em>), atau sering pula dieja <strong>basisdata</strong>, adalah kumpulan <a title=\"Informasi\" href=\"https://id.wikipedia.org/wiki/Informasi\">informasi</a> yang disimpan di dalam <a title=\"Komputer\" href=\"https://id.wikipedia.org/wiki/Komputer\">komputer</a> secara sistematik sehingga dapat diperiksa menggunakan suatu <a title=\"Program komputer\" href=\"https://id.wikipedia.org/wiki/Program_komputer\">program komputer</a> untuk memperoleh informasi dari basis data tersebut. <a title=\"Perangkat lunak\" href=\"https://id.wikipedia.org/wiki/Perangkat_lunak\">Perangkat lunak</a> yang digunakan untuk mengelola dan memanggil <a class=\"mw-redirect\" title=\"Kueri\" href=\"https://id.wikipedia.org/wiki/Kueri\">kueri</a> (<em>query</em>) basis data disebut <a title=\"Sistem manajemen basis data\" href=\"https://id.wikipedia.org/wiki/Sistem_manajemen_basis_data\">sistem manajemen basis data</a> (<em>database management system</em>, DBMS). Sistem basis data dipelajari dalam <a title=\"Ilmu informasi\" href=\"https://id.wikipedia.org/wiki/Ilmu_informasi\">ilmu informasi</a>.</p>\r\n<p>Istilah \"basis data\" berawal dari ilmu komputer. Meskipun kemudian artinya semakin luas, memasukkan hal-hal di luar bidang elektronika, artikel ini mengenai basis data komputer. Catatan yang mirip dengan basis data sebenarnya sudah ada sebelum revolusi industri yaitu dalam bentuk buku besar, kuitansi dan kumpulan data yang berhubungan dengan bisnis.</p>', 'ruang-programmer-444866Database.png', '2016-05-31 20:39:34', 'google.com', 'pengertian-basis-data', 1),
(16, 'Pengertian XML', '<p><strong>XML</strong> (<strong>Extensible Markup Language</strong>) adalah <a class=\"mw-redirect\" title=\"Bahasa markup\" href=\"https://id.wikipedia.org/wiki/Bahasa_markup\">bahasa markup</a> untuk keperluan <a title=\"Umum\" href=\"https://id.wikipedia.org/wiki/Umum\">umum</a> yang disarankan oleh <a class=\"mw-redirect\" title=\"W3C\" href=\"https://id.wikipedia.org/wiki/W3C\">W3C</a> untuk membuat dokumen markup keperluan pertukaran data antar <a title=\"Sistem\" href=\"https://id.wikipedia.org/wiki/Sistem\">sistem</a> yang beraneka ragam.<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://id.wikipedia.org/wiki/XML#cite_note-1\">[1]</a></sup> XML merupakan kelanjutan dari <a title=\"HTML\" href=\"https://id.wikipedia.org/wiki/HTML\">HTML</a> (<a class=\"mw-redirect\" title=\"HyperText Markup Language\" href=\"https://id.wikipedia.org/wiki/HyperText_Markup_Language\">HyperText Markup Language</a>) yang merupakan bahasa standar untuk melacak <a title=\"Internet\" href=\"https://id.wikipedia.org/wiki/Internet\">Internet</a>.<sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://id.wikipedia.org/wiki/XML#cite_note-2\">[2]</a></sup></p>\r\n<p>&nbsp;</p>\r\n<p>sumber : https://id.wikipedia.org/wiki/XML</p>', 'ruang-programmer-596918xml.PNG', '2016-05-31 20:42:58', 'google.com', 'pengertian-xml', 1),
(17, 'Pengertian Sistem operasi ', '<p><strong>Sistem operasi</strong> (<a title=\"Bahasa Inggris\" href=\"https://id.wikipedia.org/wiki/Bahasa_Inggris\">bahasa Inggris</a>: <em><strong>operating system</strong></em>&nbsp;; <em><strong>OS</strong></em>) adalah komponen pengolah piranti lunak dasar (<em>essential component</em>) tersistem sebagai pengelola sumber daya <a class=\"mw-redirect\" title=\"Perangkat keras komputer\" href=\"https://id.wikipedia.org/wiki/Perangkat_keras_komputer\">perangkat keras komputer</a> (hardware), dan menyediakan layanan umum untuk <a title=\"Aplikasi\" href=\"https://id.wikipedia.org/wiki/Aplikasi\">aplikasi</a> perangkat lunak. Sistem operasi adalah jenis yang paling penting dari <a title=\"Perangkat lunak sistem\" href=\"https://id.wikipedia.org/wiki/Perangkat_lunak_sistem\">perangkat lunak sistem</a> dalam sistem komputer. Tanpa sistem operasi, pengguna tidak dapat menjalankan program aplikasi pada komputer mereka, kecuali program <a class=\"mw-redirect\" title=\"Booting\" href=\"https://id.wikipedia.org/wiki/Booting\">booting</a>.</p>\r\n<p>Sistem operasi mempunyai penjadwalan yang sistematis mencakup perhitungan penggunaan memori, pemrosesan data, penyimpanan data, dan sumber daya lainnya.</p>\r\n<p>Untuk fungsi-fungsi perangkat keras seperti sebagai masukan dan keluaran dan <a class=\"new\" title=\"Alokasi memori dinamis (halaman belum tersedia)\" href=\"https://id.wikipedia.org/w/index.php?title=Alokasi_memori_dinamis&amp;action=edit&amp;redlink=1\">alokasi memori</a>, sistem operasi bertindak sebagai perantara antara program aplikasi dan perangkat keras komputer,<sup id=\"cite_ref-1\" class=\"reference\"><a href=\"https://id.wikipedia.org/wiki/Sistem_operasi#cite_note-1\">[1]</a></sup><sup id=\"cite_ref-2\" class=\"reference\"><a href=\"https://id.wikipedia.org/wiki/Sistem_operasi#cite_note-2\">[2]</a></sup> meskipun kode aplikasi biasanya dieksekusi langsung oleh perangkat keras dan seringkali akan menghubungi OS atau terputus oleh itu. Sistem operasi yang ditemukan pada hampir semua perangkat yang berisi komputer-dari <a class=\"mw-redirect\" title=\"Ponsel\" href=\"https://id.wikipedia.org/wiki/Ponsel\">ponsel</a> dan <a class=\"mw-redirect\" title=\"Konsol permainan video\" href=\"https://id.wikipedia.org/wiki/Konsol_permainan_video\">konsol permainan video</a> untuk <a title=\"Superkomputer\" href=\"https://id.wikipedia.org/wiki/Superkomputer\">superkomputer</a> dan <a title=\"Server web\" href=\"https://id.wikipedia.org/wiki/Server_web\">server web</a>.</p>', 'ruang-programmer-674009pengertian sistem operasi.png', '2016-05-31 20:44:54', 'google.com', 'pengertian-sistem-operasi-', 1),
(18, 'Pengertian SEO', '<p><strong>Pengertian SEO</strong>&nbsp;atau&nbsp;<em>Search Engine Optimization</em>&nbsp;adalah suatu teknik untuk memaksimalkan suatu website agar lebih dikenal atau lebih mudah dibaca oleh search engine.&nbsp;<a href=\"http://www.pojokwebsite.com/jasa-perawatan-website.html\">Teknik SEO</a>&nbsp;dilakukan melalui proses yang systematis artinya teknik seo</p>\r\n<div id=\"attachment_206\" class=\"wp-caption alignleft\"><img class=\"size-full wp-image-206\" title=\"teknik-seo\" src=\"http://www.pojokwebsite.com/wp-content/uploads/2011/10/teknik-seo.png\" alt=\"\" width=\"300\" height=\"250\" />\r\n<p class=\"wp-caption-text\">SEO</p>\r\n</div>\r\n<p>harus mengikuti aturan-aturan yang berlaku pada suatu search engine tertentu yang menjadi rujukannya</p>\r\n<ol>\r\n<li><strong>Teknik SEO</strong>diterapkan pada suatu website dengan tujuan untukmeningkatkan jumlah pengunjung website tersebut. Banyak sekali faktor yang menentukan keberhasilan dalam SEO namun dapat di golongkan menjadi dua yaitu :</li>\r\n<li><strong>Onpage Optimazation</strong>&nbsp;yaitu teknik melakukan optimasi dari dalam suatu website dengan jalan memodifikasi faktor-faktor tertentu dari bagian suatu website misalkan menentukan title, tag, content yang relevan dengan title dan lain-lain</li>\r\n<li>Offpage Optimazation yaitu teknik optimasi yang dilakukan dari luar bagian website dengan tetap mengacu pada alogaritma search engine tertentu misalkan memperbanyak backlink yang berkualitas</li>\r\n</ol>\r\n<p>Teknik SEO bagi kebanyakan orang bisa terbilang sulit karena membutuhkan skill yang cukup dan tingkat kesabaran yang tinggi sedangkan hasilnya tidak dapat dilihat secara langsung. Selain itu metode search engine tertentu, untuk meng-index hasil pencarian juga sering berubah. Oleh karena itu SEO dapat dikatakan sangat dinamis karena metodenya berubah dari waktu ke waktu dan juga SEO tidak dapat memberikan jaminan apakah website Anda akan muncul dalam index pencarian teratas atau tida</p>\r\n<h2 id=\"related-posts-via-categories-title\">Berhubungan Dengan...</h2>\r\n<ul id=\"related-posts-via-categories-list\">\r\n<li><a title=\"Cara Melihat Password Di Google Crome\" href=\"http://www.pojokwebsite.com/cara-melihat-password-di-google-crome.html\">Cara Melihat Password Di Google Crome</a>&nbsp;(1)</li>\r\n<li><a title=\"Mengenal Struktur Konten Joomla 1.5.xx\" href=\"http://www.pojokwebsite.com/mengenal-struktur-konten-joomla-1-5-xx.html\">Mengenal Struktur Konten Joomla 1.5.xx</a>&nbsp;(1)</li>\r\n<li><a title=\"Sejarah Internet Indonesia\" href=\"http://www.pojokwebsite.com/sejarah-internet-indonesia.html\">Sejarah Internet Indonesia</a>&nbsp;(1)</li>\r\n<li><a title=\"Search Engine\" href=\"http://www.pojokwebsite.com/search-engine.html\">Search Engine</a>&nbsp;(1)</li>\r\n<li><a title=\"Hosting ?&hellip;\" href=\"http://www.pojokwebsite.com/hosting.html\">Hosting ?&hellip;</a>&nbsp;(1)</li>\r\n</ul>', 'ruang-programmer-293637pengertian-seo-gereggi.jpg', '2016-06-15 11:37:33', 'google.com', 'pengertian-seo', 1),
(19, 'Pengertian SERVER', '<h1 class=\"post-title entry-title\">Pengertian Server</h1>\r\n<div id=\"post-body-242540001894592164\" class=\"post-body entry-content\"><strong>Pengertian server</strong>&nbsp;adalah sebuah sistem komputer yang menyediakan jenis layanan tertentu dalam sebuah&nbsp;<strong>jaringan komputer</strong>. Terkadang istilah server disebut sebagai web server. Namun umumnya orang lebih suka menyebutnya sebagai &lsquo;server&rsquo; saja. Sebuah server didukung dengan prosesor yang bersifat scalable dan RAM yang besar, juga dilengkapi dengan&nbsp;<strong>sistem operasi</strong>&nbsp;khusus. Sistem operasi ini berbeda dengan sistem operasi yang biasanya. Jika kita biasa menggunakan sistem operasi windows, MacOS dll, maka sistem operasi dari server ini mungkin berbeda. Sistem Operasi dari server adalah sistem operasi jaringan atau network operating system. Server juga bertugas untuk menjalankan&nbsp;<strong>software</strong>&nbsp;administratif. Yakni software yang mengontrol akses terhadap jaringan dan sumber daya yang terdapat di dalamnya. Hal ini termasuk file atau alat pencetak (printer), dan memberikan akses kepada workstation anggota jaringan. Di dalam sistem operasi&nbsp;<strong>server</strong>, umumnya terdapat berbagai macam service yang menggunakan arsitektur klien/server. Contoh dari service yang diberikan oleh server ini antara lain Mail Server, DHCP Server, HTTP Server, DNS Server , FTP Server dan lain lain. Setiap&nbsp;<strong>sistem operasi server</strong>&nbsp;umumnya merangkai berbagai layanan tersebut . Atau bisa juga layanan tersebut diperoleh dari pihak ketiga. Setiap layanan tersebut akan merespons terhadap request dari klien. Contoh sistem operasi&nbsp;<strong>server</strong>&nbsp;adalah Windows NT 3.51, dan dilanjutkan dengan Windows NT 4.0. Saat ini sistem yang cukup populer adalah Windows 2000 Server dan Windows Server 2003, kemudian Sun Solaris, Unix, dan GNU/Linux. Pada umumnya, sebuah server terhubung dengan client dengan kabel UTP dan sebuah Network Card. Kartu jaringan ini biasanya berupa kartu PCI atau ISA.\r\n<h3><strong>Macam-macam server</strong></h3>\r\nMacam-macam server atau jenis-jenis server dapat kita golongkan dalam beberapa golongan jjika kita lihat dari fungsinya. Misalnya:&nbsp;<strong>1.&nbsp;</strong><strong>server aplikasi (application server)</strong>Server aplikasi adalah server yang digunakan untuk menyimpan berbagai macam aplikasi yang dapat diakses oleh client&nbsp;<strong>2.&nbsp;</strong><strong>server data (data server)</strong>&nbsp;server data sendiri digunakan untuk menyimpan data baik yang digunakan client secara langsung maupun data yang diproses oleh server aplikasi.&nbsp;<strong>3.&nbsp;</strong><strong>server proxy (proxy server)</strong>&nbsp;Server proxy berfungsi untuk mengatur lalu lintas di jaringan melalui pengaturan proxy. Orang awam lebih mengenal proxy server untuk mengkoneksikan komputer client ke Internet.\r\n<h3><strong>Fungsi server</strong></h3>\r\n<strong>Fungsi server</strong>&nbsp;boleh dikatakan sangat banyak, misalnya untuk situs internet, ilmu pengetahuan dan lain-lain. Namun seceara sederhana fungsi server adalah untuk penyimpanan data. Nah dari sini, semoga anda paham dengan&nbsp;<strong>pengertian server</strong>.</div>', 'ruang-programmer-755611solutions-server.png', '2016-06-15 11:40:00', 'google.com', 'pengertian-server', 1),
(20, 'Pengertian http', '<p>Nama domain (domain name) adalah nama unik yang diberikan untuk mengidentifikasi nama server komputer seperti web server atau email server di jaringan komputer ataupun internet. Nama domain berfungsi untuk mempermudah pengguna di internet pada saat melakukan akses ke server, selain juga dipakai untuk mengingat nama server yang dikunjungi tanpa harus mengenal deretan angka yang rumit yang dikenal sebagai IP address. Nama domain ini juga dikenal sebagai sebuah kesatuan dari sebuah situs web seperti contohnya &ldquo;<span class=\"skimlinks-unlinked\">wikipedia.org</span>&rdquo;. Nama domain kadang-kadang disebut pula dengan istilah URL, atau alamat website.</p>\r\n<p>Pada awalnya nama domain hanya dapat dituliskan dengan ke-26 abjad Latin, namun saat ini telah dimungkinkan untuk menggunakan abjad asing dengan Internasionalisasi nama domain.</p>\r\n<p>Sistem nama domain (DNS) adalah aturan yang dipakai dalam sistem penamaan dari nama domain ini.<br /><a href=\"http://4.bp.blogspot.com/_9FlygVV5KWw/TE3DVidC7QI/AAAAAAAAAyg/sT-sh4a-vLg/s1600/untitled.bmp\"><img src=\"https://i1.wp.com/4.bp.blogspot.com/_9FlygVV5KWw/TE3DVidC7QI/AAAAAAAAAyg/sT-sh4a-vLg/s400/untitled.bmp\" alt=\"\" border=\"0\" /></a></p>\r\n<p><strong>Pengertian Hosting :</strong></p>\r\n<p>Hosting (disebut juga Web Hosting / sewa hosting) adalah penyewaan tempat untuk menampung data-data yang diperlukan oleh sebuah website dan sehingga dapat diakses lewat Internet. Data disini dapat berupa file, gambar, email, aplikasi/program/script dan database.</p>\r\n<p>Pengertian Hosting dapat diibaratkan sebagai contoh berikut; sebuah website diibaratkan sama dengan kios/ruangan di Mall.</p>\r\n<p>Manajemen Mall menyewakan ruangan, infrastruktur, listrik, telepon dan fasilitas lainnya agar orang-orang dapat membuka usaha. Setiap kios pengelolanya dapat berbeda, dekorasinya berlainan dan beroperasi masing-masing dengan caranya sendiri. Dalam hal ini kios atau ruangan yang disewa tentu mempunyai batasan ruangan (mis: 10m x 7m) dan maksimum adalah besarnya gedung Mall tersebut.<a href=\"https://pwtpurwosari.files.wordpress.com/2010/11/domaintechcont.jpg\"><img class=\"aligncenter size-thumbnail wp-image-134\" title=\"domaintechcont\" src=\"https://pwtpurwosari.files.wordpress.com/2010/11/domaintechcont.jpg?w=150&amp;h=94\" alt=\"\" width=\"150\" height=\"94\" /></a></p>\r\n<p><strong>Pengertian WWW</strong>&nbsp;:</p>\r\n<p>Www atau World Wide Web maupun Web saja adalah sebuah sistem yang saling terkait dalam sebuah dokumen berformat hypertext yang berisi beragam informasi, baik tulisan, gambar, suara, video, dan informasi multimedia lainnya dan dapat diakses melalui sebuah perangkat yang disebut web browser.</p>\r\n<p><img src=\"https://i1.wp.com/www.yourname.net.au/images/ist2_7677184-www.jpg\" alt=\"\" width=\"220\" height=\"217\" /></p>\r\n<p><strong>Pengertian&nbsp;FTP :</strong></p>\r\n<p>(singkatan dari File Transfer Protocol) adalah sebuah protokol internet yang berjalan di dalam lapisan aplikasi yang merupakan standar untuk pentransferan berkas (file) komputer antar mesin-mesin dalam sebuah internetwork.</p>\r\n<p><img src=\"https://i0.wp.com/2.bp.blogspot.com/_5mBoaWnilL8/TMc-PB6o-KI/AAAAAAAAAH0/X0ZwdbqS-mk/s1600/ftp.png\" alt=\"\" width=\"354\" height=\"300\" /></p>\r\n<p><strong>Pengertian Hypertext Transfer Protocol (HTTP) :</strong></p>\r\n<p>adalah sebuah protokol jaringan lapisan aplikasi yang digunakan untuk sistem informasi terdistribusi, kolaboratif, dan menggunakan hipermedia. Penggunaannya banyak pada pengambilan sumber daya yang saling terhubung dengan tautan, yang disebut dengan dokumen hiperteks</p>\r\n<p><img src=\"https://i1.wp.com/3.bp.blogspot.com/_szLhUF1v5IM/TC35gvXCZcI/AAAAAAAAAsk/skfaguPWWUU/s1600/http.jpg\" alt=\"\" width=\"400\" height=\"300\" /></p>\r\n<p><strong>Pengertian HTML</strong>&nbsp;:<br />HTML atau<strong>&nbsp;HyperText Markup Language</strong>&nbsp;adalah program mark-up yang digunakan untuk membuat sebuah halaman web, menampilkan berbagai informasi di dalam sebuah Penjelajahan web Internet dan formating hypertext sederhana yang ditulis kedalam berkas format ASCII agar dapat menghasilkan tampilan wujud yang terintegerasi.</p>\r\n<p><img src=\"https://i1.wp.com/1.bp.blogspot.com/_Gm0_JucUgaA/TMBnYXGLZ7I/AAAAAAAAAMQ/nJtULr5dwhg/s1600/html-icon.png\" alt=\"\" width=\"256\" height=\"256\" /></p>\r\n<p><strong>Pengertian&nbsp;URL :</strong></p>\r\n<p>(Uniform Resource Locator) adalah rangkaian karakter menurut suatu format standar tertentu, yang digunakan untuk menunjukkan alamat suatu sumber seperti dokumen dan gambar di Internet</p>\r\n<p><img src=\"https://i2.wp.com/ictwatch.com/internetsehat/wp-content/uploads/2010/07/url-shortened-dlm.jpg\" alt=\"\" width=\"560\" height=\"300\" /></p>', 'ruang-programmer-188253Internet1.jpg', '2016-06-15 11:41:32', 'google.com', 'pengertian-http', 1);
