INSERT INTO `static_content` (`id`, `nama_halaman`, `isi`, `gambar`, `tgl_update`) VALUES
(1, 'Cara Pemesanan dan Pembayaran Web', '<p>&nbsp;</p>\r\n<ol>\r\n<li>Silahkan Anda mengisi&nbsp;<strong>Form Order</strong>&nbsp;pembuatan web, bisa&nbsp;<a href=\"order-jasa-pembuatan-website-online-di-jogja.html\"><span><strong>&nbsp;<span>klik disini</span></strong></span></a>&nbsp;atau anda bisa langsung menghubungi kami :<br />\r\n<p>Email &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;: support@ruangprogrammer.com</p>\r\n<p>HotLine Service : 081224669905 (WhatsApp)</p>\r\n<p>atau&nbsp;<a href=\"kontak-ruang-programmer-software-solution-jasa-bikin-website-murah-di-jogja.html\"><strong>klik disini</strong></a>&nbsp;untuk meninggalkan pesan<br /><br /></p>\r\n</li>\r\n<li>Setelah anda mengisi semua data di Form Order Online tersebut, kami akan segera merespon dengan menghubungi anda&nbsp;kembali baik via telepon, SMS, atau E-mail.<br /><br /></li>\r\n<li>Kami akan mengirimkan&nbsp;<strong>Proposal</strong>, dan&nbsp;<strong>invoice pembayaran</strong>&nbsp;ke email anda, dengan menyebutkan ke rekening mana pembayaran dilakukan.<br /><br /></li>\r\n<li>Ada 2 Sistem Pembayaran yang perlu diperhatikan<br />\r\n<p>a) &nbsp; &nbsp;Melakukan pembayaran langsung 100% apabila paket biaya pembuatan web dibawah Rp 2 juta (sesuai perjanjian)</p>\r\n<p>b) &nbsp; &nbsp;Melakukan pembayaran minimal 60%&nbsp; apabila paket biaya web diatas Rp 2 juta dan pelunasan pembayaran sebesar 40% dari nilai kontrak saat web sudah online.<br /><br /></p>\r\n</li>\r\n<li>Anda bisa menyiapkan bahan untuk web anda meliputi Profil Bisnis/Instansi anda, foto kegiatan/foto produk, detail kontak/alamat, artikel, logo jika ada, dll yang ingin ditampilkan dalam web.&nbsp; &nbsp;<em>(kelangkapan data web bisa dikonsultasikan dengan kami.<br /><br /></em></li>\r\n<li>Proses pengerjaan web adalah rata-rata 5-9 hari kerja (Profil Bisnis), 9-15 hari kerja (Toko Online, Bisnis), 15-25 hari Kerja (Perusahaan) atau menyesuaikan paket Web yang Anda pesan.<br /><br />\r\n<p>Waktu pengerjaan juga menyesuaikan dengan diterimanya seluruh bahan/data web dari klien.&nbsp;</p>\r\n<p>Jadi jika ada data&nbsp;pending/susul-menyusul, waktu pengerjaan akan kita disesuaikan.</p>\r\n<p>Progress pembuatan web akan kami sampaikan/laporkan setiap saat ada perkembangan.<br /><br /></p>\r\n</li>\r\n<li>Kontrak web development / pembuatan web, meliputi pengerjaan pembuatan web hingga maintenance selama 1 tahun (masa kontrak).<br />\r\n<p>Untuk tahun ke-2 dan seterusnya hanya dikenai biaya perpanjangan domain dan hosting serta maintenance&nbsp;selama kontak masih berlangsung.</p>\r\n<p>&nbsp;</p>\r\n<p>Informasi lebih lengkap tentang hal tersebut diatas, mohon hubungi kami :&nbsp;</p>\r\n<p>HotLine Service &nbsp; &nbsp; :081224669905(cp Ghufron Edi Wibowo)</p>\r\n<!--<p>YM &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp;<a href=\"mailto:support@ruangprogrammer.com\">support@ruangprogrammer.com</a>&nbsp;</p> -->\r\n<p>Email &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; :&nbsp;<a href=\"mailto:support@ruangprogrammer.com\">support@ruangprogrammer.com&nbsp;</a></p>\r\n</li>\r\n</ol>', '', '2016-03-07 16:03:11'),
(2, 'Profil Ruang Programmmer', '<p style=\"text-align: left;\" align=\"center\"><strong>ruang Programmer Software Solution</strong>&nbsp;, tempatnya&nbsp; bikin&nbsp; web murah, ramah, dan berkualitas.</p>\r\n<p style=\"text-align: left;\" align=\"center\"><br />ruang Programmer Software Solution adalah perusahaan jasa pembuatan web yang ada di Jogja dengan mengedepankan pelayanan ke pada klien, kami menawarkan jasa pembuatan web dengan harga murah dan hasil yang berkualitas. ruang Programmer Software Solution berpusat di Jogja,&nbsp; walaupun demikian jangkauan layanan kami tidak hanya di Jogja dan sekitarnya, kami melayani jasa pengembangan web&nbsp; untuk seluruh wilayah nusantara.<br /><br />Semua desain web kami buat&nbsp; secara unik sesuai keinginan klien (web custom). Itu salah satu bagian yang menjadi ciri khas web kami. Web yang kami buat untuk Anda kami desain seunik mungkin sesuai dengan ciri khas yang klien inginkan. Selain unik kami juga membuat web yang ramah untuk dikunjungi sehingga semakin meningkatkan kualitas perusahaan atau instansi Anda. Tentunya dengan biaya murah web yang kami tawarkan untuk Anda akan sangat mendukung keuntungan yang berlimpah untuk perusahaan Anda.</p>\r\n<p style=\"text-align: left;\"><br />5 alasan kenapa Anda harus memilih ruang Programmer Software Solution&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left; margin-left: 30px;\"><strong>1. Biaya Murah</strong></p>\r\n<p style=\"text-align: left; margin-left: 30px;\">ruang Programmer Software Solution menyediakan web yang murah untuk Anda. Mulai dari 500rb Anda sudah bisa memiliki web.</p>\r\n<p><strong>&nbsp;</strong></p>\r\n<p style=\"margin-left: 30px;\"><strong>2. Ramah Pengunjung<br /></strong></p>\r\n<p style=\"margin-left: 30px;\">ruang Programmer Software Solution menyediakan web yang ramah pengunjung sehingga perusahaan / instansi Anda akan semakin dikenal.</p>\r\n<p style=\"margin-left: 60px;\">&nbsp;</p>\r\n<p style=\"margin-left: 30px;\"><strong>3. Berkualitas</strong></p>\r\n<p style=\"margin-left: 30px;\">Jogja Budy Web &nbsp;menyediakan web yang berkualitas. Web yang kami buat selalu berkonsep cerdas sesuai dengan keunikan Anda.</p>\r\n<p style=\"margin-left: 60px;\">&nbsp;</p>\r\n<p style=\"margin-left: 30px;\"><strong>4. Free Desain Costum</strong></p>\r\n<p style=\"margin-left: 30px;\">ruang Programmer Software Solution &nbsp;menawarkan free desain costum untuk semua paketnya, sehingga Anda bebas menentukan desain sesuai keinginan Anda.</p>\r\n<p style=\"margin-left: 60px;\">&nbsp;</p>\r\n<p style=\"margin-left: 30px;\"><strong>5. Layanan 24/7</strong></p>\r\n<p style=\"margin-left: 30px;\">ruang Programmer Software Solution selalu mengedepankan akan kepuasan pelanggan. Jangan ragu untuk menghubungi dan berkonsultasi dengan kami. Tim kami akan selalu siap membantu selama 24/7.<br /><br /></p>\r\n<p>Segeralah Anda pelajari paket-paket web yang kami tawarkan dan bergegaslah untuk memesan ke kami, kapan lagi keinginan Anda untuk memiliki web idaman Anda kalau tidak sekarang.</p>', '', '2016-03-07 22:34:59'),
(3, 'support@ruangprogrammer.com', '', 'support@ruangprogrammer.com', '2016-04-03 22:37:38'),
(4, 'Alamat Kami', '<p><span>\r\nJl. Plosokuning 1 Dusun Gantalan <br>\r\nRT 03/RW 01 No. 66, Minomartani, <br>\r\nNgaglik, Sleman, DI Yogyakarta 55581<br></span></p>', '', '2016-02-24 00:11:23'),
(5, 'support@ruangprogrammer.com', '', 'Order Online', '2014-10-22 21:36:17'),
(6, 'Karir', '<p><strong>Website Marketing (WM)<br /><br /></strong></p>\r\n<p>Jogja Budy Web adalah perusahaan bergerak dibidang web development, sedang membutuhkan karyawan untuk posisi <strong>Website Marketing </strong>&nbsp;yang berkomitmen kuat dan mempunyai kualifikasi sebagai berikut:<br /><br /></p>\r\n<ul>\r\n<li>Pria/Wanita</li>\r\n<li>Usia 18-28</li>\r\n<li>Pendidikan minimal SMA/K, D3, S1, Sedang kuliah, Fresh graduate</li>\r\n<li>Freelancer</li>\r\n<li>Aktif, pandai negosiasi, komunikatif, interaktif dan punya ide-ide kreatif</li>\r\n<li>Aktif di berbagai forum, Social Media dan situs jual beli lainnya</li>\r\n<li>Paham dan familiar dengan internet</li>\r\n<li>Bisa design grafis dan membuat web menjadi nilai tambah </li>\r\n<li>Unlimited Income </li>\r\n</ul>\r\n<p><br /><br />Kirim segera berkas lamaran berupa :&nbsp;</p>\r\n<p>Surat Lamaran, CV/Riwayat Hidup dgn menyebutkan portofolio (jika ada), FC Ijasah / Transkrip Terakhir.<br /> Ke : hrd@jogjabudyweb.com (subject : WM)</p>\r\n<p>&nbsp;</p>', '', '2014-10-21 23:40:04'),
(7, 'Tentang Ruang Programmer', '<p style=\"margin-left: 30px;\"><strong><br />Siapakan Kami ?</strong></p>\r\n<p style=\"margin-left: 60px;\">Ruang Programmer Software Solution adalah perusahaan jasa pembuatan web yang ada di Jogja dengan mengedepankan pelayanan ke pada klien, kami menawarkan jasa pembuatan web dengan harga murah dan hasil yang berkualitas. ruang Programmer Software Solution &nbsp;berpusat di Jogja,&nbsp; walaupun demikian jangkauan layanan kami tidak hanya di Jogja dan sekitarnya, kami melayani jasa pengembangan web&nbsp; untuk seluruh wilayah nusantara.<br /><br /></p>\r\n<p style=\"margin-left: 30px;\"><strong>Bagaimana saya menghubungi ruang Programmer Software Solution ?</strong></p>\r\n<p style=\"margin-left: 60px;\">Anda dapat mengubungi kami melalui</p>\r\n<p style=\"margin-left: 60px;\"><strong>HotLine Service </strong><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong><strong>: 081224669905&nbsp;</strong><strong><br /></strong></p>\r\n<!--<p style=\"margin-left: 60px;\"><strong>YM &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : </strong><strong><a href=\"mailto:ruangprogrammer@yahoo.com\">ruangprogrammer@yahoo.com</a>&nbsp;</strong></p> -->\r\n<p style=\"margin-left: 60px;\"><strong>Email &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; : </strong><a href=\"mailto:support@ruangprogrammer.com\"><strong>support@ruangprogrammer.com</strong></a></p>\r\n<p>&nbsp;</p>\r\n<p style=\"margin-left: 30px;\"><strong>Kelebihan apa saja yang ditawarkan &nbsp;ruang Programmer Software Solution ?</strong></p>\r\n<p style=\"margin-left: 60px;\">Semua desain web kami buat&nbsp; secara unik sesuai keinginan klien (web custom). Itu salah satu bagian yang menjadi ciri khas web kami. Web yang kami buat untuk Anda kami desain seunik mungkin sesuai dengan ciri khas yang klien inginkan. Selain unik kami juga membuat web yang ramah untuk dikunjungi sehingga semakin meningkatkan kualitas perusahaan atau instansi Anda. Tentunya dengan biaya murah web yang kami tawarkan untuk Anda akan sangat mendukung keuntungan yang berlimpah untuk perusahaan Anda.<br /><br /></p>\r\n<p style=\"margin-left: 30px;\"><strong>Kenapa harus memilih ruang Programmer Software Solution ?</strong></p>\r\n<p style=\"margin-left: 60px;\">5 alasan kenapa Anda harus memilih ruang Programmer Software Solution&nbsp;<br /><br /></p>\r\n<p style=\"margin-left: 60px;\"><span style=\"font-size: small;\"><strong>1. &nbsp; Biaya Murah</strong></span></p>\r\n<p style=\"margin-left: 90px;\"><span style=\"font-size: small;\">Ruang Programmer Software Solution menyediakan web yang murah untuk Anda. Mulai dari 500rb Anda sudah bisa memiliki web.</span></p>\r\n<p style=\"margin-left: 60px;\"><span style=\"font-size: small;\"><strong>2. &nbsp;&nbsp;</strong><strong>Ramah Pengunjung</strong></span></p>\r\n<p style=\"margin-left: 90px;\"><span style=\"font-size: small;\">ruang Programmer Software Solution menyediakan web yang ramah pengunjung sehingga perusahaan / instansi Anda akan semakin dikenal.</span></p>\r\n<p style=\"margin-left: 60px;\"><span style=\"font-size: small;\"><strong>3. &nbsp; Berkualitas</strong></span></p>\r\n<p style=\"margin-left: 90px;\"><span style=\"font-size: small;\">ruang Programmer Software Solution menyediakan web yang berkualitas. Web yang kami buat selalu berkonsep cerdas sesuai dengan keunikan Anda.</span></p>\r\n<p style=\"margin-left: 60px;\"><span style=\"font-size: small;\"><strong>4. &nbsp; Free Desain Costum</strong></span></p>\r\n<p style=\"margin-left: 90px;\"><span style=\"font-size: small;\">ruang Programmer Software Solution menawarkan free desain costum untuk semua paketnya, sehingga Anda bebas menentukan desain sesuai keinginan Anda.</span></p>\r\n<p style=\"margin-left: 60px;\"><span style=\"font-size: small;\"><strong>5. &nbsp; Layanan 24/7</strong></span></p>\r\n<p style=\"margin-left: 90px;\"><span style=\"font-size: small;\">ruang Programmer Software Solution selalu mengedepankan akan kepuasan pelanggan. Jangan ragu untuk menghubungi dan berkonsultasi dengan kami. Tim kami akan selalu siap membantu selama 24/7.</span></p>\r\n<div style=\"margin-left: 30px;\">\r\n<p style=\"margin-left: 30px;\">&nbsp;<strong>&nbsp;</strong></p>\r\n</div>\r\n<p><strong>Pertanyaan Umum<br /></strong></p>\r\n<p style=\"margin-left: 30px;\"><strong><br /></strong><strong>Bagaimana cara melakukan pemesanan &amp; pembayaran ke ruang Programmer Software Solution?</strong></p>\r\n<p style=\"text-align: left; margin-left: 60px;\">Pemesanan bisa dilakukan dengan mengisi form pemesanan melalui menu ORDER, atau hubungi Hotline Service kami. Rekening pembayaran akan dikirim tim kami melalui email atau sms.<br /><br /></p>\r\n<p style=\"margin-left: 30px;\"><strong>Bagaimana caranya saya mengkonfirmasi bukti pembayaran?</strong></p>\r\n<p style=\"margin-left: 60px;\">Anda dapat mengirim konfirmasi bukti transfer via email ke support@ruangprogrammer.com (subject : KONFIRMASI) dengan melampirkan attachment bukti tansfer beserta nilai transaksi, tanggal dan nomor rekening&nbsp;atau melalui sms ke No 081224669905 dengan cara format <strong>SMS</strong> : nomor transfer # nominal # paket web # Bank Tujuan # nama # alamat&rdquo;</p>\r\n<p style=\"margin-left: 30px;\"><strong>&nbsp;</strong></p>\r\n<p style=\"margin-left: 30px;\"><strong>Berapa lama Pengerjaan web saya?</strong></p>\r\n<p style=\"margin-left: 60px;\">Proses pengerjaan web adalah 5-9 hari kerja (paket tertentu) setelah seluruh bahan/data website kami terima (kecuali ada data pending) dan kami akan berusaha secepatnya. <br />Kontrak web development meliputi pengerjaan pembuatan website hingga maintenance selama 1 tahun</p>', '', '2016-03-07 16:10:20'),
