INSERT INTO `testi` (`id`, `nama`, `email`, `isi`, `status`, `tanggal`) VALUES
(1, 'Didik Santoso', '', 'Pelayanan Tim Ruang Programmer Software Solution bener2 OK, apa yang aku mau langsung direspons dan dikerjakan....SUKSES Bro..', 1, '2014-10-14 21:59:57'),
(3, 'Bpk. Iwan Hartanto', '', 'Tadinya aku ragu dengan Ruang Programmer Software Solution, tapi setelah saya lihat hasilnya memang luar biasa. Harganya juga murah. Makasih Ruang Programmer. Suskses trs', 1, '2014-10-14 22:00:32'),
(4, 'Pak Irvan Aditya', '', 'Desainnya Ruang Programmer luar biasa. Aku bisa pilih desain bebas meskipun yang tak pilih paket murah. Ruang Programmer memang beda dari yang lain!', 1, '2014-10-09 23:00:44'),
(5, 'Hendra Budi Permana', '', 'Toko onlineku sekarang jadi laris berkat buat website sama Ruang Programmer. Pelayanannya juga ramah2..', 1, '2014-10-14 22:00:54'),
(6, 'Wiyarto', '', 'Tim Ruang Programmer besedia dipanggil ke kantor aku. Jadi aku gak usah repot2 harus ketemu dengan tim Ruang Programmer. ! Sukses trs', 1, '2014-10-14 22:01:05'),
(7, 'Mbak Amelia', '', 'Meski budget aku minim, Ruang Programmer mau memberikan pelayanan terbaiknya. Web harga kantong mahasiswa pun bisa dipesan. ThankYou so Much Ruang Programmer!', 1, '2014-10-14 22:01:16');
